# Standart libraries
import json

# Third party packages
import allure
import pytest
import pytest_check as check
from jsonschema import validate
from pydantic import ValidationError

# My packages
from pytest_DataCenter_functional.test_REST_API.tools import schema_models
from pytest_DataCenter_functional.test_REST_API.tools.dc_base_url import DcApiWithToken

url_tail = "/api/v2/data_center/user_cards/attached_files?userID=1"


@allure.epic("DataService API v2 (user_cards)")
@allure.feature("File list for REST_test_user_cyrillic")
@pytest.mark.testRESTAPI
@allure.story(
    "Получает список файлов или содержимое файла по пользователю REST_test_user_cyrillic"
)
class TestFileListForUser:
    @allure.title("Успешность запроса")
    def test_status_code_200(self, dc_api: DcApiWithToken):
        r = dc_api.req_get(url_tail)
        assert r.status_code == 200

    @allure.title("Headers 'content-type'")
    def test_content_type(self, dc_api: DcApiWithToken):
        con_type = dc_api.req_get(url_tail).headers["content-type"]
        assert con_type == r"application/json; charset=utf-8"

    @allure.title("Время ответа запроса")
    def test_response_time(self, dc_api: DcApiWithToken):
        resp_time = dc_api.req_get(url_tail).elapsed.total_seconds()
        assert resp_time <= 30

    @allure.title("Файл в формате *txt")
    def test_file_txt(self, dc_api: DcApiWithToken):
        data_dict = dc_api.req_get(url_tail).json()
        with allure.step("Дата создания"):
            check.equal(data_dict["data"][0]["createDate"], 1661429098)
        with allure.step("Комментарий"):
            check.equal(data_dict["data"][0]["description"], "Текстовый файл")
        with allure.step("Идентификатор аккаунта"):
            check.equal(data_dict["data"][0]["fileID"], 2)
        with allure.step("Имя файла"):
            check.equal(data_dict["data"][0]["fileName"], "operations.txt")
        url_tail_for_body = (
            "/api/v2/data_center/user_cards/attached_files?fileID=2&userID=1"
        )
        data_dict = dc_api.req_get(url_tail_for_body).json()
        with allure.step("Содержимое файла в base64"):
            check.equal(
                data_dict["data"][0]["fileBody"],
                "",
            )

    @allure.title("Файл в формате *dll")
    def test_file_dll(self, dc_api: DcApiWithToken):
        data_dict = dc_api.req_get(url_tail).json()
        with allure.step("Дата создания"):
            check.equal(data_dict["data"][1]["createDate"], 1661429105)
        with allure.step("Комментарий"):
            check.equal(data_dict["data"][1]["description"], "Файл библиотеки ")
        with allure.step("Идентификатор аккаунта"):
            check.equal(data_dict["data"][1]["fileID"], 1)
        with allure.step("Имя файла"):
            check.equal(data_dict["data"][1]["fileName"], "postproc-53.dll")
        url_tail_for_body = (
            "/api/v2/data_center/user_cards/attached_files?fileID=1&userID=1"
        )
        data_dict = dc_api.req_get(url_tail_for_body).json()
        with allure.step("Содержимое файла в base64"):
            check.equal(
                data_dict["data"][0]["fileBody"],
                "",
            )

    @allure.title("Проверка возвращаемой схемы JSON")
    def test_schema(self, dc_api: DcApiWithToken):
        schema = {
            "type": "object",
            "properties": {"data": {"type": "array"}},
            "required": ["data"],
        }
        resp = dc_api.req_get(url_tail).json()
        validate(resp, schema=schema)

    @allure.title("Проверка возвращаемой схемы JSON")
    def test_schema2(self, dc_api: DcApiWithToken):
        data_dict = dc_api.req_get(url_tail).json()
        error_list = []
        for row in data_dict["data"]:
            try:
                schema_models.SchemaModelsDataServiceAPIv2.FileListForUser.parse_obj(
                    row
                )
            except ValidationError as e:
                error_list.append(f"Error found in object: {row}\n{e.json()}\n")
        try:
            schema_models.SchemaModelsDataServiceAPIv2.FileListForUser.parse_obj(
                data_dict["data"][0]
            )
        except Exception as e:
            if error_list:
                raise Exception(f"{''.join(error_list)}\n{e}")
            else:
                raise Exception(e)
